tables.table_schema:
CREATE TABLE EarthquakeEvents (
    event_id INT PRIMARY KEY,
    location VARCHAR(255),
    magnitude FLOAT,
    time_stamp TIMESTAMP
);

CREATE TABLE MapVisualizations (
    visualization_id INT PRIMARY KEY,
    visualization_name VARCHAR(255),
    map_data JSON
);

CREATE TABLE regions (
  region_id INT PRIMARY KEY,
  name VARCHAR,
  description TEXT
);

CREATE TABLE Earthquakes (
    id INT PRIMARY KEY,
    location VARCHAR,
    magnitude FLOAT,
    date TIMESTAMP
);

CREATE TABLE Epicenters (
    id INT PRIMARY KEY,
    epicenter_location VARCHAR,
    epicenter_depth INT,
    epicenter_date TIMESTAMP
);

CREATE TABLE Maps (
    id INT PRIMARY KEY,
    map_name VARCHAR,
    map_image BYTEA,
    map_date TIMESTAMP
);

CREATE TABLE TimePeriod (
    id INT PRIMARY KEY,
    time_period_name VARCHAR,
    start_date TIMESTAMP,
    end_date TIMESTAMP
);
